import './Blogs.css';
import Image from '../main_imgs/divider.jpg';
import Image_1 from '../main_imgs/blog-thumb-1.jpg';
import Image_2 from '../main_imgs/blog-thumb-2.jpg';
import Image_3 from '../main_imgs/blog-thumb-3.jpg';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faArrowRightToBracket } from '@fortawesome/free-solid-svg-icons';
const Blogs = () => {
    let blogImgs = [ Image_1, Image_2, Image_3 ];
    return(
        <div className="section-blogs">
            <div className="blogs">
                <div className="section-header">
                    <div className='section-header-desc'>
                        <h2 className='bg-header'>WHAT'S HAPPENING</h2>
                    </div>
                    <span>OUR BLOG</span>
                    <h1>Recent News</h1>
                    <img className='header-line' alt='header-line' src={Image} />
                </div>
                <div className='blogs-content grid-3-cols'>
                    <div className='blog-single'>
                        <img src={blogImgs[0]}  alt='blog-img' />
                        <div className='blog-data'>
                            <span>December 20, 2020 | BY JOHN DOE</span>
                        </div>
                        <div className='blog-title'>
                            <h4><a href="#/">Lorem ipsum dolor sit a met</a></h4>
                        </div>
                        <div className='blog-text'>
                            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Curabitur lectus lacus, rutrum sit amet...</p>
                        </div>
                        <div className='blog-readMore'>
                            <button><FontAwesomeIcon icon={faArrowRightToBracket} /></button>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}
export default Blogs;
